mongoose: sort and paginating the field inside $project<pre><code>$project: {
  _id: 1,
  edited: 1,
  game: {
    gta: {   
      totalUserNumber: {
        $reduce: {
          input: &quot;$gta.users&quot;,
          initialValue: 0,
          in: { $add: [{ $size: &quot;$$this&quot; }, &quot;$$value&quot;] },
        },
      },
      userList: &quot;$gta.users&quot;, &lt;----- paginating this
    },
    DOTA2: {
        totalUserNumber: {
          $reduce: {
            input: &quot;$dota2.users&quot;,
            initialValue: 0,
            in: { $add: [{ $size: &quot;$$this&quot; }, &quot;$$value&quot;] },
          },
        },
        userList: &quot;$dota2.users&quot;, &lt;------ paginating this
      },
    },
   .... More Games
  },
</code></pre>
<p>I have this <code>$project</code>. I have paginated the list of games by using <code>$facet</code>,<code>$sort</code>, <code>$skip</code> and <code>$limit</code> after <code>$project</code>.</p>
<p>I am trying also trying to paginate each game's <code>userList</code>. I have done to get the total value in order to calculate the page number and more.</p>
<p>But, I am struggling to apply <code>$sort</code> and <code>$limit</code> inside the <code>$project</code>. So far, I have just returned the document and then paginated with the return value. However, I don't think this is very efficient and wondering if there is any way that I can paginate the field inside the <code>$project</code>.</p>
<p>Is there any way that I can apply <code>$sort</code> and <code>$limit</code> inside the <code>$project</code>, in order to apply pagination to the fields and return?</p>
<blockquote>
<p>------ Edit ------</p>
</blockquote>
<p>this is for paginating the field. Because, I am already paginating the document (game list), I could not find any way that I can paginate the field, because I could not find any way that I can apply <code>$facet</code> to the field.</p>
<p>e.g. document</p>
<pre><code>[
   gta: {
     userID: ['aa', 'bb', 'cc' ......],
   },
   dota: {
     userID: ['aa', 'bb', 'cc' ......],
   }
   ....
]
</code></pre>
<p>I am using <code>$facet</code> to paginate the list of games (dota, gta, lol and more). However, I did not want to return all the <code>userID</code>. I had to return the entire document and then paginate the <code>userID</code> to replace the json doc.</p>
<p>Now, I can paginate the field inside the <code>aggregate pipeline</code> by using <code>$function</code>.</p>
<p>thanks to <a href="https://stackoverflow.com/questions/15388127/mongodb-sort-inner-array">Mongodb sort inner array</a> !</p>
<pre><code>const _function = function (e) {
    e // &lt;---- will return userID array. You can do what you want to do.
    return {

    };
  };
   game
    .collection(&quot;game&quot;)
    .aggregate([
      {},
      {
        $set: {
          &quot;game&quot;: {
            $function: {
              body: _function,
              args: [&quot;$userID&quot;],
              lang: &quot;js&quot;,
            },
          },
        },
      },
    ])
    .toArray();
</code></pre>
<p>By using <code>$function</code> multiple time, you will be able to paginate the field. I don' really know if this is faster or not tho. Plus, make sure you can use <code>$function</code>. I read that you can't use this if you are on the free tier at Atlas.</p>

